import React from 'react';
import TodoItem from './TodoItem';
const styles = {
    backgroundColor: '#AFEEEE'
}

function App() {
    return(
        <div className='wrapper'>
            <h2>Todo List:</h2> 
            <ol style={styles}>
                <li><TodoItem user={{input: "Buy a milkss"}}/></li>
                <li><TodoItem user={{input: "Buy a cow"}}/></li>
                <li><TodoItem user={{input: "Buy a bread"}}/></li>
            </ol>
        </div>
    )
};

export default App;
